function Table(props: any) {
  const { datasource = [], headerStyle = {}, headers = [], noBorder } = props;
  const tableStyle: any = {
    borderCollapse: 'collapse',
    tableLayout: 'fixed',
    width: '100%',
    margin: '20px 0',
  };

  const cellStyle: any = {
    padding: '20px',
    textAlign: 'center',
    overflow: 'hidden',
    textOverflow: 'ellipsis',
    whiteSpace: 'nowrap',
  };

  if (noBorder) {
    cellStyle.border = 'none';
  }

  const headerCellStyle = {
    ...cellStyle,
    fontWeight: 'bold',
    textAlign: 'left',
  };

  const rows = datasource.map((row: any) => {
    let newRow = Array.isArray(row) ? row : [row];
    return newRow.map((d, di) => (
      <tr key={di}>
        {headers.map((header: any, i: number) => (
          <td
            style={{ ...cellStyle, ...(row.style ?? {}) }}
            key={i}
            className="table-border"
          >
            {d[header]}
          </td>
        ))}
      </tr>
    ));
  });
  return (
    <div>
      <table style={tableStyle}>
        <thead>
          <tr>
            {headers.map((header: any, index: number) => (
              <th
                key={index}
                style={{ ...headerCellStyle, ...headerStyle }}
                className="table-border"
              >
                {header}
              </th>
            ))}
          </tr>
        </thead>
        <tbody>{rows}</tbody>
      </table>
    </div>
  );
}

export default Table;
